    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Flint Hills NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Flint Hills NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the refuges, an overview of the CCP process, a summary of refuge resources, management
    programs, administrative guidelines, and strategies for plan implementation. Key
    planning issues include: habitat management, public use, cultural resources, interagency
    coordination, staffing, funding, threatened and endangered species, and farming.",nt"license_title":
